import React, { Component } from 'react';
import { Text, View } from 'react-native';
import {AppButton} from './pages/AppButton'

export default class Login extends Component {
    render() {
        return (
            <View>
              <AppButton
              name="Login"
              color="green"
              />
            </View>
        )
    }
}

